import "./Homepage.css";
import Question from "./Question";

const mbg = document.querySelector("homepage-container")

mbg.addEventListener("mousemove", (e) => {
  mbg.style.backgroundPositionX = -e.offsetX + "px";
  mbg.style.backgroundPositionY = -e.offsetY + "px";
});

const Homepage = () => {
  return(
    <div className="homepage-container" id="homepage-container">
      <h1 className="header">Random Jeopardy Questions!</h1>

      <Question />

      <button className="new-btn">New Question</button>
    </div>
  );
}

export default Homepage;
